import React, { Component } from 'react';
import './HomeContent.css'
import WindCard from './WindCard';

class HomeContent extends Component {
    constructor(props){
        super(props);
        this.state = {

        }
    }
    render(){
        return (
                <main id="layout-container">
                    <div id="content">
                        <div class="grid-container content-container">
                            <div class="grid-card">
                                <div class="full-size">
                                    <span class="card-title">INTERACTIVE WEATHER</span>
                                    <div class="colour-card blue full-size">
                                        
                                    </div>
                                </div>
                            </div>
                            <div class="grid-card">
                                <div class="full-size">
                                    <span class="card-title">WIND</span>
                                    <div class="full-size">
                                      <WindCard StationName={"LOCAL"} StationLocation={"Goring"} StationDistance={"0"} CurrentSpeed={"40"} Direction={"WSW"}/>
                                      <WindCard StationName={"WORTHING SAILING CLUB"} StationLocation={"Goring"} StationDistance={"0.8"} CurrentSpeed={"40"} Direction={"WSW"}/>
                                      <WindCard StationName={"LANCING"} StationLocation={"Lancing"} StationDistance={"6.6"} CurrentSpeed={"40"} Direction={"WSW"}/>
                                    </div>
                                </div>
                            </div>
                            <div class="grid-card">
                               <div class="full-size">
                                    <span class="card-title">TIDE</span>
                                    <div class="colour-card orange full-size">
                                        
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </main>
        )
    }
}

export default HomeContent;
